window.IndexPage=class extends Page{constructor(){super()}setup(){if(super.setup(),"mobile"===this.device){const a={},e=document.querySelector("table");if(e){a.headers=Array.from(e.querySelectorAll("thead th")),a.data=Array.from(e.querySelectorAll("tbody tr")).map((e,r)=>Array.from(e.querySelectorAll("td, th"))),e.remove();for(var t of a.data){const r=$('<div class="card"></div>'),d=$('<div class="card-body"></div>');for(let r=0;r<t.length;r++){let e=t[r].textContent;0<t[r].children.length&&(e=`<a href="${t[r].children[0].getAttribute("href")}">${t[r].children[0].textContent}</a>`),""!==e&&d.append(`
                    <div class="history-data-wrap"">
                        <div class="history-data-wrap__column">${a.headers[r].textContent}</div>
                        <div class="history-data-wrap__separator"><i class="material-icons">arrow_right_alt</i></div>
                    <div class="history-data-wrap__value">${e}</div>
                    </div>
                `)}r.append(d),r.appendTo($("#recent-actions-card > .card-body"))}}}}rendered(){super.rendered()}};